import React, { useEffect, useState } from 'react';
import { Navigate } from 'react-router-dom';
import { useSelector } from "react-redux";
import "./student.css";
import userApi from "../../services/user.service";
// import MaterialTable from "material-table";
// import tableIcons from "../../shared/materialIcons/matTableIcons";


export default function Dashboard() {
  const { user: currentUser } = useSelector((state) => state.auth);
  if(!currentUser) {
    return <Navigate to="/login"/>
  }

  const [loading, setLoading] = useState(true);
  const [users, setData] = useState('')

  useEffect(()=>{
    const fetchData = async()=>{
      setLoading(true);
      try {
        const { data: response } = await userApi.getUsers()
        setData(response);
        console.log(response)
      } catch (err) {
        console.log(err);
      }
      setLoading(false);
    };
    fetchData();
  }, []);

  return(
    <div className='flex column'>
      <div className="flex row users-nav">
        <p>Registered Users</p>
        <button type="button" className="flex flex-center">
            <strong>+ &nbsp;</strong>
            add user
        </button>
      </div>
      <div className="flexLayout column reg-users-container">
          {loading && <div>loading..</div>}
          {!loading && (<table>
            <tbody>
              <tr>
                <th>#</th>
                <th>Name</th>
                <th>Email</th>
                <th>Joined</th>
                <th>Actions</th>
              </tr>
              {users['usersList'].map((user, index)=>
                (
                  <tr>
                    <td>{index+1}.</td>
                    <td>
                      <a href={user.id}>
                          {user.firstname} gawgagaewl{user.lastname}
                      </a>                            
                    </td>
                    <td>{user.email}</td>
                    <td>{user.joined}</td>
                    <td>
                      <span className="edit" >Edit</span>
                      <span className="delete" >Delete</span>
                    </td>
                  </tr>
                ))
              }
            </tbody>
          </table>)}
          <div className='flex info'>
            <span>items per page {users.page}&nbsp;&nbsp;&nbsp;&nbsp;</span>
            <span>page {users.page}&nbsp;&nbsp;&nbsp;&nbsp;</span>
            <span>total {users.totalUsers}</span>
          </div>
      </div>
    </div>
  );
}
